import React from 'react';

import Button from 'react-bootstrap/Button';


export default function GoButton (props) {
	return (
		<div className="go-button">
			<Button 
				size="lg"
				variant="primary"
				 > 
				Go! 
			</Button>
		</div>

	);

}
